import React from "react";
const Heading = () => {
  return (
    <header className="App-header">
      <img
        className="App-logo"
        src="https://image.flaticon.com/icons/svg/139/139899.svg"
        alt="CYF-Hotel Logo"
      />
      <h1 className="App-title">CYF Hotel</h1>
    </header>
  );
};
export default Heading;
